import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


ReactDOM.render(
  <React.StrictMode>
    <index />
  </React.StrictMode>,
  document.getElementById('main_cust')
);

import Header from './MyComponets/Header';
import Slider from './MyComponets/Slider';
import {Content} from './MyComponets/Content';
import {Footer} from './MyComponets/Footer';
ReactDOM.render(
  <React.StrictMode>
    <index />
  </React.StrictMode>,
  document.getElementById('main_cust')
);

function index() {
  return (
  <>
  <Header title="My React App"/>
  <Slider/>
  <Content/>
  <Footer/>
  </>
  );
}

export default App;
